import React, { useState } from "react";
import { Card, CardContent, Button, Typography, Grid, Paper, TextField } from "@mui/material";

const Home = () => {
  const [driveLink, setDriveLink] = useState("");
  const [imageList, setImageList] = useState([]);
  const [referenceImage, setReferenceImage] = useState(null);
  const [referenceFile, setReferenceFile] = useState(null);

  const extractFolderId = (url) => {
    const match = url.match(/[-\w]{25,}/);
    return match ? match[0] : null;
  };

  const handleFetchImages = async () => {
    const folderId = extractFolderId(driveLink);
    if (!folderId) {
      alert("Invalid Google Drive link");
      return;
    }
    try {
      const response = await fetch(`http://localhost:8000/fetch-images?folder_id=${folderId}`);
      const data = await response.json();

      if (response.ok) {
        if (data && Array.isArray(data.images)) {
          const updatedImages = data.images.map(name => ({ name, url: `http://localhost:8000/downloaded_images/${name}` }));
          setImageList(updatedImages);
        } else {
          alert("No images found in the folder.");
        }
      } else {
        alert(`Error fetching images: ${data.error || "Unknown error"}`);
      }
    } catch (error) {
      console.error("Error fetching images:", error);
      alert("Failed to fetch images.");
    }
  };

  const handleImageSelect = (event) => {
    const file = event.target.files[0];
    if (file) {
      setReferenceFile(file);
      const reader = new FileReader();
      reader.onload = (e) => {
        setReferenceImage(e.target.result);
      };
      reader.readAsDataURL(file);
    }
  };

  const handleScan = async () => {
    if (!referenceFile) {
      alert("Please upload a reference image.");
      return;
    }

    const formData = new FormData();
    formData.append("file", referenceFile);

    const uploadResp = await fetch("http://localhost:8000/upload-ref", {
      method: "POST",
      body: formData,
    });

    const uploaded = await uploadResp.json();
    const referenceImagePath = uploaded.path;

    const folderId = extractFolderId(driveLink);
    const scanResp = await fetch("http://localhost:8000/scan", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ reference_image_path: referenceImagePath, folder_id: folderId }),
    });

    const result = await scanResp.json();
    const matched = result.matched_images.map(name => ({ name, url: `http://localhost:8000/downloaded_images/${name}` }));
    setImageList(matched);
  };

  return (
    <Card sx={{ maxWidth: 600, margin: "auto", mt: 5, p: 3, textAlign: "center", boxShadow: 3, borderRadius: 2 }}>
      <CardContent>
        <Typography variant="h4" fontWeight="bold" gutterBottom>
          PersonaScan
        </Typography>

        <TextField
          fullWidth
          label="Google Drive Folder Link"
          variant="outlined"
          value={driveLink}
          onChange={(e) => setDriveLink(e.target.value)}
          sx={{ mb: 2 }}
        />
        <Button variant="contained" color="primary" fullWidth sx={{ mb: 2 }} onClick={handleFetchImages}>
          Fetch Images
        </Button>

        <Grid container spacing={1} justifyContent="center" sx={{ mb: 2, overflowX: "auto", flexWrap: "nowrap" }}>
          {imageList.length > 0 ? (
            imageList.map((image, index) => (
              <Grid item key={index}>
                <Paper sx={{ width: 80, height: 80, overflow: "hidden" }}>
                  <img src={image.url} alt={`uploaded-${index}`} style={{ width: "100%", height: "100%", objectFit: "cover" }} />
                </Paper>
              </Grid>
            ))
          ) : (
            <Typography variant="body2" color="textSecondary">
              No images available.
            </Typography>
          )}
        </Grid>

        <Button variant="contained" color="primary" fullWidth component="label" sx={{ mb: 2 }}>
          Upload Reference Image
          <input type="file" hidden onChange={handleImageSelect} />
        </Button>

        {referenceImage && (
          <Paper sx={{ width: 80, height: 80, overflow: "hidden", margin: "auto", mb: 2 }}>
            <img src={referenceImage} alt="reference" style={{ width: "100%", height: "100%", objectFit: "cover" }} />
          </Paper>
        )}

        <Button variant="contained" color="success" fullWidth sx={{ py: 1.5 }} onClick={handleScan}>
          Scan
        </Button>
      </CardContent>
    </Card>
  );
};

export default Home;
